import {GET_ALL_STUDIES} from '../apiConfig'
import {USERS_URL} from '../redux/action';
const axios = require('axios').default; 

export function getAllLanguages(){
       return axios.get(GET_ALL_STUDIES)
            .then(function (response) {
                // handle success
                return response.data;
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })

}
            export function newUserToDB(){
                return axios.get(USERS_URL)
                     .then(function (response) {
                         // handle success
                         return response.data;
                     })
                     .catch(function (error) {
                         // handle error
                         console.log(error);
                     })
                    }
